import React from "react";
import './login.css';

export default class Login extends React.Component{

    state = {
        email: '',
        password: ''
    }

    render(){
        return(
            <div style={{width: 720, height: 512, paddingTop: 38.5, paddingBottom: 43, paddingLeft: 216, paddingRight: 194.5, background: '#ECECEC', justifyContent: 'flex-end', alignItems: 'center', display: 'inline-flex'}}>
            <div style={{width: 309.5, height: 430.5, position: 'relative'}}>
              <div style={{width: 309.5, height: 430.5, left: 0, top: 0, position: 'absolute', background: '#DBDBDB', borderRadius: 15}}></div>
              <div style={{left: 82.5, top: 26.5, position: 'absolute', color: '#838383', fontSize: 50, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word'}}>LOGO</div>
              <div style={{width: 242, height: 109.5, left: 34, top: 159.5, position: 'absolute'}}>
                <div style={{left: 5, top: 0, position: 'absolute', color: '#838383', fontSize: 15, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word'}}>Login</div>
                <div style={{left: 5, top: 56, position: 'absolute', color: '#838383', fontSize: 15, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word'}}>Senha</div>
                <div style={{width: 242, height: 28, padding: 5, left: 0, top: 20.5, position: 'absolute', background: '#ECECEC', borderRadius: 2.5, borderBottom: '1px #838383 solid'}} />
                <div style={{width: 242, height: 28, padding: 5, left: 0, top: 81.5, position: 'absolute', background: '#ECECEC', borderRadius: 2.5, borderBottom: '1px #838383 solid'}} />
              </div>
              <div style={{width: 217.5, height: 27, left: 46, top: 345.5, position: 'absolute'}}>
                <div style={{width: 217.5, height: 27, left: 0, top: 0, position: 'absolute', background: '#838383', borderRadius: 5, border: '0.5px white solid'}} />
                <div style={{width: 217.5, left: 0, top: 6, position: 'absolute', textAlign: 'center', color: 'white', fontSize: 12, fontFamily: 'Inter', fontWeight: '700', wordWrap: 'break-word'}}>ENTRAR</div>
              </div>
              <div style={{left: 109.5, top: 382.5, position: 'absolute', color: '#838383', fontSize: 10, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word'}}>Esqueceu a senha?</div>
              <div style={{left: 81.5, top: 87, position: 'absolute', color: '#838383', fontSize: 16, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word'}}>Bem Vindo ao SGP</div>
            </div>
          </div>

          )
    }

    styles = {
        colMd6:{
            position: 'relative',
            left: '300x'
        }
    };


}
